import React, { Component } from 'react';
import TopNav from '../../components/TopNav/TopNav';
import Navigation from '../../components/Navigation/Navigation';

export default class Pocenta extends Component {
	render() {
		return (
			<React.Fragment>
				<TopNav />
				<Navigation />
			</React.Fragment>
		);
	}
}
